@Component({
  selector: 'app-logo',
  templateUrl: './logo.component.html',
  styleUrls: ['./logo.component.scss']
})
export class LogoComponent {

}
<app-link url="/">
    <div class="logo-container">
        <img src="assets/sinv_logo.svg" alt="" />
        <div class="logo-text">sinv</div>
    </div>
</app-link>
